INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1081, 15465, 'Modafinil', 'Administration with food may delay the absorption of modafinil (the racemate) and armodafinil (the R-enantiomer) without significantly affecting their overall bioavailability.  According to the product labeling, modafinil''s absorption may be delayed by approximately one hour if taken with food.  Similarly, the time to reach peak plasma concentration (Tmax) of armodafinil may be delayed by approximately 2 to 4 hours in the fed state.', 'dairy products', 'Minor', '', 'DDInter', 0, X'789c358cb10d80300c0457f9121a0ac41a0c61b023223918d9a1607b5c4079f7a75f8da9d4b32ae2b05b199b80b8a5892e2e0cea50a1e89891814706c55c302c1f2781a9fa83cb8defbdc78854ff4c257fd08434a6177c5a2709', NULL, X'');
