INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1098, 24196, 'Mycophenolic acid', 'Administration of enteric coated mycophenolic acid with meals may alter its pharmacokinetics relative to administration in the fasting state.  When mycophenolic acid 720 mg was administered with a high-fat meal, there was a 33% decrease in the peak plasma concentration (Cmax); a 3.5-hour increase in delay time for the rise of plasma mycophenolic acid; and a 5-hour delay in the time to reach peak plasma concentration (Tmax).  However, no effect was observed on the systemic exposure of mycophenolic acid.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1103, 17536, 'Nateglinide', 'Alcohol may cause hypoglycemia or hyperglycemia in patients with diabetes.  Hypoglycemia most frequently occurs during acute consumption of alcohol.  Even modest amounts can lower blood sugar significantly, especially when the alcohol is ingested on an empty stomach or following exercise.  The mechanism involves inhibition of both gluconeogenesis as well as the counter-regulatory response to hypoglycemia.  Episodes of hypoglycemia may last for 8 to 12 hours after ethanol ingestion.  By contrast, chronic alcohol abuse can cause impaired glucose tolerance and hyperglycemia.  Moderate alcohol consumption generally does not affect blood glucose levels in patients with well controlled diabetes.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
