INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1112, 21415, 'Asparaginase Erwinia chrysanthemi', 'Concomitant use of asparaginase with other hepatotoxic agents may potentiate the risk of liver injury.  Asparaginase-associated hepatotoxicity has been reported more commonly in adults than in children and has been strongly associated with obesity.  Hepatomegaly, acute severe hepatotoxicity, and fatal liver failure have been reported with asparaginase treatment in adults.  Also, asparaginase may increase the toxicity of drugs bound to plasma proteins or metabolized by the liver.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
