INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1158, 28190, 'Niacin', 'Ethanol can exacerbate the cutaneous flushing that is a common side effect of niacin.  At least one case of delirium and lactic acidosis has been reported with coadministration of these drugs, although data are limited.  ', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c1d8cd10d02310cc5567903209660925c1aae4f6a9b2a69856e7b0e7e6dcb2f97d239982b64d107b2fa6e0533fc90a35d380c85a9be434e2b0f4c8945dd4de296c9a106ade1830af591bbcfffc6dfb893d320ddf758f903d2d4ab37302199ae9465051fae8a7a4d8bc6c9629df2fc02fe8e394d', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1159, 24646, 'Nicardipine', 'Many psychotherapeutic and CNS-active agents (e.g., anxiolytics, sedatives, hypnotics, antidepressants, antipsychotics, opioids, alcohol, muscle relaxants) exhibit hypotensive effects, especially during initiation of therapy and dose escalation.  Coadministration with antihypertensives and other hypotensive agents, in particular vasodilators and alpha-blockers, may result in additive effects on blood pressure and orthostasis.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1160, 24646, 'Nicardipine', 'The consumption of grapefruit juice may be associated with significantly increased plasma concentrations of some calcium channel blockers (CCBs) when they are administered orally.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  The interaction has been reported with the dihydropyridine CCBs (in roughly decreasing order of magnitude) felodipine, nisoldipine, nifedipine, and nimodipine, often with a high degree of interindividual variability.  Grapefruit juice caused more than twofold increases in felodipine, nifedipine, and nisoldipine AUCs.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1161, 27924, 'Nilotinib', 'Grapefruit juice may increase the plasma concentrations of nilotinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1162, 27925, 'Nilotinib', 'Grapefruit juice may increase the plasma concentrations of nilotinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1163, 23973, 'Nintedanib', 'Food enhances the oral bioavailability of nintedanib.  After food intake, nintedanib exposure increased by approximately 20% compared to administration under fasted conditions.  Absorption was also delayed, as indicated by an increase in the median time to reach maximum plasma concentration (Tmax) from 2 hours in the fasted state to approximately 4 hours under fed conditions, irrespective of the type of food ingested.', 'food', 'Moderate', '', 'DDInter', 0, X'789cf3cbcc2b494d49cccb4c5228cec82fcd4951484a55484cc9cdcccb2c2e492d4a4d5128cf2cc95048cbcf4fd1030077be107e', NULL, X'');
